const About = () => {
  return (
    <div className="home">
      <h1>Action expresses Priorities</h1>
      <h5>The key is not to prioritize what's on your schedule, schedule your priorities</h5>
      <div className="buttons">
        <button>Sign-up</button>
        <button>Log-in</button>
      </div>
    </div>
  );
}
 
export default About;
